(1, 'Le Cèpe', 36, 1800, '2023-11-04 09:02:40', '2024-11-02 08:30:00', 'https://www.strava.com/routes/3281528908003230040', '<h2>Le roi des champignons !</h2><br><br>\r\n\r\nUn beau parcours exigeant pour les vaillants, avec des vues imprenables sur les fôrets aux alentours !\r\nAu programme : du partage, du dépassement de soi, du dénivelé, de beaux paysages mais surtout de bons ravitos !\r\n<br><br>\r\n\r\nLes infos clés :<br><br>\r\n- Kilomètres : {{ distanceCourse }}km<br>\r\n- Dénivelé positif : {{ dplusCourse }}m<br>\r\n- Départ : {{ heureDepartTheoriqueCourse }}\r\n\r\n<br><br>\r\n2 points de ravitaillement intermédiaire et 1 point de ravitaillement à l\'arrivée : <br><br>\r\n- Ravito 1 : Rochepaule (solide + liquide)<br>\r\n- Ravito 2 : La Chapelle-sous-Rochepaule  (solide + liquide)<br><br>\r\n\r\n<br><br>\r\nProfitez d\'un repas copieux à base de produits locaux à l\'arrivée (en option lors de l\'inscription).\r\n<br><br>\r\n\r\n\r\nLes dossards seront à retirer sur présentation d’une pièce d’identité et de votre carte retrait dossard et ce à titre individuel le : Samedi 2 novembre de 6h30 à 8h00 – La Halle de Saint-André-en-Vivarais', '7H', 2, 50, 10, 10, 60, 10),
(2, 'La Girolle', 15, 800, '2023-11-04 10:03:50', '2024-11-02 09:30:00', 'https://www.strava.com/routes/3281528476190515756', '<h2>La Girolle on en raffole !</h2>\r\n\r\nUn parcours pour les fugueux qui débute par une belle descente de 300 mètres. Il ne va pas falloir traîner ! \r\n<br><br>\r\nAu programme : du partage, de bons ravitos avec un poil de vitesse (n\'oubliez pas les lunettes) !\r\n\r\nLes infos clés :<br><br>\r\n- Kilomètres : {{ distanceCourse }}km<br>\r\n- Dénivelé positif : {{ dplusCourse }}m<br>\r\n- Départ : {{ heureDepartTheoriqueCourse }}\r\n\r\n<br><br>\r\n\r\n1 point de ravitaillement intermédiaire et 1 point de ravitaillement à l\'arrivée<br>\r\n--> Ravito 1 : La Chapelle-sous-Rochepaule  (solide + liquide)<br><br>\r\n\r\nProfitez d\'un repas copieux à base de produits locaux à l\'arrivée (en option lors de l\'inscription).<br><br>\r\n\r\n\r\nLes dossards seront à retirer sur présentation d’une pièce d’identité et de votre carte retrait dossard et ce à titre individuel le : Samedi 2 novembre de 6h30 à 8h00 – La Halle de Saint-André-en-Vivarais', '3H', 1, 50, 10, 5, 30, 10),
(3, 'La Rando Morille', 11, 500, '2023-11-04 10:03:50', '2024-11-02 09:00:00', 'https://www.strava.com/routes/3281529307134047788', '<h2>Une Morille et c\'est la quille !</h2>\r\n\r\nUne belle rando pour y aller mollo !<br><br>\r\n\r\nUn parcours très chouette, accessible à tous et toutes avec un ravito surprise au milieu ! De quoi partager un bon moment sportif et digérer les excès de la veille ou simplement prendre l\'air !\r\n<br><br>\r\n\r\nLes infos clés :<br><br>\r\n- Kilomètres : {{ distanceCourse }}km<br>\r\n- Dénivelé positif : {{ dplusCourse }}m<br>\r\n- Départ : {{ heureDepartTheoriqueCourse }}\r\n<br><br>\r\n1 point de ravitaillement intermédiaire et 1 point de ravitaillement à l\'arrivée : Le Château Montivert (solide + liquide)\r\n<br><br>\r\nProfitez d\'un repas copieux à base de produits locaux à l\'arrivée (en option lors de l\'inscription).\r\n<br><br>\r\nBarrières Horaires :\r\nLe jour-même à 16h !\r\n<br><br>\r\nPas de dossards pour la rando mais veuillez vous présenter à La Halle de Saint-André-en-Vivarais afin qu\'on puisse s\'assurer de votre présence', NULL, 1, NULL, 0, NULL, 7, 10);
